import { CardImg, Img, Title, Wrap } from "./styled";
import { Companies } from "../../../assets/index";
import { StarWrapper, StarsContainer } from "src/commonStyles";

interface Props {
  imgUrl: string;
  name: string;
  reviewsScore: number;
}

export default function DoctorCard(props: Props) {
  return (
    /* <Wrap>
      <Img $backgroundImg={props.imgUrl || Companies.CompanyImg} />
      <Title>{props.name}</Title>
      <StarsContainer>
        {Array(5)
          .fill(null)
          .map((_, index) => {
            return (
              <StarWrapper
                $isActive={index < props.reviewsScore}
                key={index + 1}
              >
                <Companies.StarRate />
              </StarWrapper>
            );
          })}
      </StarsContainer>
    </Wrap> */
    <Wrap
      onClick={() =>
        navigate(
          `${APP_ROUTES.CATALOG}/${props.catalogCard.name.split(" ").join("-")}`
        )
      }
      >
      <CardImg
        $background={
          props.catalogCard.imgUrl ||
          "https://static.vecteezy.com/system/resources/previews/004/493/181/original/hospital-building-for-healthcare-background-illustration-with-ambulance-car-doctor-patient-nurses-and-medical-clinic-exterior-free-vector.jpg"
        }
      />
      <Container>
        <Text $height="45px" $width="650px">
          {props.catalogCard.name}
        </Text>
        <Text $height="145px" $width="650px">
          {props.catalogCard.address}
        </Text>
      </Container>
    </Wrap>
  );
}
